import React, { useContext } from 'react'
import TodoContext from '../context/TodoContext'

const TodoList = () => {
    const [tasks, setTasks] = useContext(TodoContext)
    const newArr = tasks.toSorted((a, b) => a.time.localeCompare(b.time))
    console.log(newArr)
    console.log(new Date(newArr[0]['time']))
    return (
        <>
            <div className="">
                <ul className="divide-y-2">
                    {newArr.map(task => {
                        return (
                            <li key={task.id} className='p-6 flex gap-4 items-center'>
                                <input type="checkbox" name="" id="" />
                                <div className="grow w-2/4">
                                    <p className=' text-sm font-normal text-slate-600 line-clamp-2'>{task.title}</p>
                                    <p className='text-xs font-normal text-slate-400'>{task.time}</p>
                                </div>
                                <div>
                                    <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor" className="w-4 h-4 text-sm">
                                        <path strokeLinecap="round" strokeLinejoin="round" d="m14.74 9-.346 9m-4.788 0L9.26 9m9.968-3.21c.342.052.682.107 1.022.166m-1.022-.165L18.16 19.673a2.25 2.25 0 0 1-2.244 2.077H8.084a2.25 2.25 0 0 1-2.244-2.077L4.772 5.79m14.456 0a48.108 48.108 0 0 0-3.478-.397m-12 .562c.34-.059.68-.114 1.022-.165m0 0a48.11 48.11 0 0 1 3.478-.397m7.5 0v-.916c0-1.18-.91-2.164-2.09-2.201a51.964 51.964 0 0 0-3.32 0c-1.18.037-2.09 1.022-2.09 2.201v.916m7.5 0a48.667 48.667 0 0 0-7.5 0" />
                                    </svg>
                                </div>
                            </li>
                        )
                    })}
                </ul>
            </div>
        </>
    )
}

export default TodoList
